import { useSelector } from "react-redux";

import HistoryTableRow from "./HistoryTableRow";
import "./HistoryTable.css";

const HistoryTable = () => {
  // Get history

  // Render component
  return (
    <div className="history-table">
      <div className="row history-table__header">
        <h6 className="col-2 d-none d-lg-block">ID ORDER</h6>
        <h6 className="col-2 d-none d-lg-block">ID USER</h6>
        <h6 className="col-2">NAME</h6>
        <h6 className="col-2 col-lg-1">PHONE</h6>
        <h6 className="col-2 col-lg-1">ADDRESS</h6>
        <h6 className="col-1">TOTAL</h6>
        <h6 className="col-2 col-lg-1">DELIVERY</h6>
        <h6 className="col-1">STATUS</h6>
        <h6 className="col-2 col-lg-1">DETAIL</h6>
      </div>
      {/* Render history items */}
      {/* {history.products.map((prod, index) => (
        <HistoryTableRow product={prod.product} qty={prod.qty} key={index} />
      ))} */}
    </div>
  );
};

export default HistoryTable;
